import classes from './MyForm.module.css';
import { useState, useRef } from 'react';

const MyForm = () => {

  const [toggleFlag, setToggleFlag] = useState(false);
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');


  const submitHandler = (e) => {
    e.preventDefault();
    setToggleFlag(true);
  }

  const onChangeName = (e) => {
    e.preventDefault();
    setFirstName(e.target.value);
  }

  const onChangeLastName = (e) => {
    e.preventDefault();
    setLastName(e.target.value);
  }
  const onChangeEmail = (e) => {
    e.preventDefault();
    setEmail(e.target.value);
  }
  const onChangePassword = (e) => {
    e.preventDefault();
    setPassword(e.target.value);
  }



  return (
    <div className="App">
      {!toggleFlag && <form className={classes.form} onSubmit={submitHandler} >
        <div className={classes.control}>
          <label htmlFor='email'><h2>My Details</h2></label>
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>First Name</label>
          <input type='text' required onChange={onChangeName} />
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>Last Name</label>
          <input type='text' required  onChange={onChangeLastName} />
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>Email</label>
          <input type='text' required onChange={onChangeEmail}  />
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>Password</label>
          <input type='text' required onChange={onChangePassword} />
        </div>
        <div className={classes.action}>
          <button>Submit</button>
        </div>
      </form>}
      {toggleFlag && <div>
        <table>
          <tr>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email</th>
            <th>Password</th> 
          </tr>
          <tr >
            <td>{firstName}</td>
            <td>{lastName}</td>
            <td>{email}</td>
            <td>{password}</td>

          </tr> 
        </table>
      </div>}
    </div>
  );
}

export default MyForm;
